export class Chapter {
  private _name?: string;
  private _id?: number;

  constructor(id?: number, name?: string) {
    this._name = name;
    this._id = id;
  }

  get name(): string | undefined {
    return this._name;
  }

  set name(name: string | undefined) {
    this._name = name;
  }

  get id(): number | undefined {
    return this._id;
  }

  set id(id: number | undefined) {
    this._id = id;
  }
}
